Let's think step by step. We start with the equation $(15-2(5-a))^2=63$. Expanding the left-hand side of the equation using the rules of exponents, we get $(15-10+2a)^2=(5+2a)^2$. Now let us expand the squared binomial. Using the rule $(a+b)^2=a^2+2ab+b^2$, we get $25+20a+4a^2$. Thus our original equation becomes $4a^2+20a+25=63.$ Subtracting $63$ from both sides, we obtain $4a^2+20a-38=0$. To solve this quadratic equation, we will use the quadratic formula $a=\dfrac{-b\pm\sqrt{b^2-4ac}}{2a}$ where $a=4,b=20,$ and $c=-38$. Plugging in these values into the formula yields \begin{align*}
a&=\dfrac{-20\pm\sqrt{(20)^2-4\cdot4\cdot(-38)}}{2\cdot4}\\
&=\dfrac{-20\pm\sqrt{400+608}}{8}\\
